import React, { useState, useEffect } from "react";
import axios from "axios";
import "./AuthorityDashboard.css";

const AuthorityDashboard = () => {
  const [activeTab, setActiveTab] = useState("pending");
  const [complaints, setComplaints] = useState([]);
  const [tasks, setTasks] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetch complaints based on tab
  useEffect(() => {
    if (activeTab === "pending") {
      fetchComplaints("Pending");
    } else if (activeTab === "inprogress") {
      fetchComplaints("In Progress");
    } else if (activeTab === "completed") {
      fetchComplaints("Completed");
    } else if (activeTab === "tasks") {
      fetchTasks();
    }
  }, [activeTab]);

  const fetchComplaints = async (status) => {
    setLoading(true);
    try {
      const res = await axios.get(
        `http://localhost:8081/Complaint-chain/api/complaints/status/${status}`
      );
      setComplaints(res.data);
    } catch (err) {
      console.error("Error fetching complaints", err);
    } finally {
      setLoading(false);
    }
  };

  const fetchTasks = async () => {
    setLoading(true);
    try {
      const res = await axios.get(
        "http://localhost:8081/Complaint-chain/api/tasks"
      );
      setTasks(res.data);
    } catch (err) {
      console.error("Error fetching tasks", err);
    } finally {
      setLoading(false);
    }
  };

  const handleMarkCompleted = async (complaintId) => {
    try {
      await axios.put(
        `http://localhost:8081/Complaint-chain/api/complaints/${complaintId}/status`,
        { status: "Completed" }
      );
      fetchComplaints("In Progress"); // refresh list
    } catch (err) {
      console.error("Error updating complaint", err);
    }
  };

  return (
    <div className="authority-dashboard">
      <h2 className="dashboard-title">Authority Dashboard</h2>

      <div className="tabs">
        <button
          className={activeTab === "pending" ? "active" : ""}
          onClick={() => setActiveTab("pending")}
        >
          Pending Complaints
        </button>
        <button
          className={activeTab === "inprogress" ? "active" : ""}
          onClick={() => setActiveTab("inprogress")}
        >
          In Progress
        </button>
        <button
          className={activeTab === "completed" ? "active" : ""}
          onClick={() => setActiveTab("completed")}
        >
          Completed
        </button>
        <button
          className={activeTab === "tasks" ? "active" : ""}
          onClick={() => setActiveTab("tasks")}
        >
          My Tasks
        </button>
      </div>

      <div className="tab-content">
        {loading ? (
          <p>Loading...</p>
        ) : activeTab === "tasks" ? (
          <ul className="list">
            {tasks.map((task) => (
              <li key={task.id}>
                <strong>Complaint ID:</strong> {task.complaintId} <br />
                <strong>Assigned Date:</strong> {task.assignedDate} <br />
                <strong>Deadline:</strong> {task.deadline}
              </li>
            ))}
          </ul>
        ) : (
          <ul className="list">
            {complaints.map((c) => (
              <li key={c.id}>
                <strong>{c.title}</strong> â€” {c.description}
                <br />
                <em>Status: {c.status}</em>
                {activeTab === "inprogress" && (
                  <button
                    className="mark-btn"
                    onClick={() => handleMarkCompleted(c.id)}
                  >
                    Mark Completed
                  </button>
                )}
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default AuthorityDashboard;
